import "./App.css";
import Header from "./components/Header";
function App() {
  return (
    <div className="App">
      <Header />
      <div className="">
        <video controls muted>
          <source src="http://localhost:4000/video" type="video/mp4"></source>
        </video>
      </div>
    </div>
  );
}

export default App;
